    self.walls = self.map["WALLS"] or {}
    self.selector = {
        ["BUSHES"] = function(x, y) return self:IsBush(x, y, true) end,
        ["RIVERS"] = function(x, y) return self:IsRiver(x, y, true) end,
        ["WALLS"] = function(x, y) return self:IsWall(x, y, true) end
    }
    self.translator = {
        [HOWLING_ABYSS_MAP_ID] = {
            function(x) return RoundDown(x, 5, 4) end,
            function(y) return RoundUp(y, 5, 4) end
        },
        [SUMMONER_RIFT_MAP_ID] = {
            function(x) return RoundDown(x, 5, 0) end,
            function(y) return RoundUp(y, 5, 2) end
        }
    }
end

function MapLibrary:BreadthFirstSearch(x, y, key)
    local queue, visit = {}, {}
    table.insert(queue, {x = x, y = y})
    visit[x] = {[y] = true}
    while #queue > 0 do
        local point = queue[1] or nil
        if not point then return nil end
        table.remove(queue, 1)
        local px, py = point.x, point.y
        if self.selector[key](px, py) then
            return px * 10 + 25, py * 10 - 25
        end
        for index = 1, 4 do
            local ax = px + self.dirX[index] * 5
            local ay = py + self.dirY[index] * 5
            if not (visit[ax] and visit[ax][ay]) then
                table.insert(queue, {x = ax, y = ay})
                if not visit[ax] then visit[ax] = {} end
                visit[ax][ay] = true
            end
        end
    end
    return nil
end

function MapLibrary:FindClosestBush(x, y)
    local rx, ry = self:Translate(x, y, false)
    return self:BreadthFirstSearch(rx, ry, "BUSHES")
end

function MapLibrary:FindClosestRiver(x, y)
    local rx, ry = self:Translate(x, y, false)
    return self:BreadthFirstSearch(rx, ry, "RIVERS")
end

function MapLibrary:FindClosestWall(x, y)
    local rx, ry = self:Translate(x, y, false)
    return self:BreadthFirstSearch(rx, ry, "WALLS")
end

function MapLibrary:IsBush(x, y, skip)
    local rx, ry = self:Translate(x, y, skip, "MIXED")
    return self.bushes[rx] and self.bushes[rx][ry]
end

function MapLibrary:IsRiver(x, y, skip)
    if self.id == 0 then return false end
    local rx, ry = self:Translate(x, y, skip)
    return self.rivers[rx] and self.rivers[rx][ry]
end

function MapLibrary:IsWall(x, y, skip)
    local rx, ry = self:Translate(x, y, skip)
    if self.id == SUMMONER_RIFT_MAP_ID then return
        self.walls[rx] and self.walls[rx][ry] end
    return (self.grounds[rx] == nil
        or self.grounds[rx][ry] == nil)
        and (self.bushes[rx] == nil
        or self.bushes[rx][ry] == nil)
end

function MapLibrary:Translate(x, y, skip)
    if skip then return x, y end
    local rx, ry = x * 0.1, y * 0.1
    local tr = self.translator[self.id]
    return tr[1](rx), tr[2](ry)
end

return MapLibrary
